import './NewExpense.css';

const NewExpense = () =>{

    const HandleExpenseData = () => {
        return({
            ...expenseData,
            id: Math.random.toString()
        })

    }

    return(
        <div className='new-expense'>
           <ExpenseForm onPutData={HandleExpenseData}/>
        </div>
    )
}

export default NewExpense;
